import React from 'react';



const navbar = () => {
    return (
        <div className='navbarWrapper'>
            <div className='navbarContainer'>
                <div className='nabvarItem'>
                    <p>Home</p>
                    <p>Team</p>
                    <p>Gärtnerei</p>
                    <p>Landschaftsgärtner</p>
                    <p>Floristik</p>
                    <p>Grabbetreuung</p>
                    <p>Kontakt</p>
                    <p>Impressum</p>
                    <p>Social Media</p>
                </div>
            </div>
        </div>
    );
};
export default navbar;
